import { Box, Grid } from "@mui/material";

const DoubleBox = ({ children, props1, props2 }) => {
  return (
    <Box bgcolor="#b6b6b6ff" {...props1}>
      <Grid bgcolor="white" {...props2}>
        {children}
      </Grid>
    </Box>
  );
};

export default DoubleBox;
